const Colors = {
  "icon-lizard.svg": "radial-gradient(circle, white 56%, hsl(261, 73%, 60%), hsl(261, 72%, 63%) 10%)",
  "icon-paper.svg": "radial-gradient(circle, white 56%, hsl(230, 89%, 62%), hsl(230, 89%, 65%) 10%)",
  "icon-rock.svg": "radial-gradient(circle, white 56%, hsl(349, 71%, 52%), hsl(349, 70%, 56%) 10%)",
  "icon-scissors.svg": "radial-gradient(circle, white 56%, hsl(39, 89%, 49%), hsl(40, 84%, 53%) 10%)",
  "icon-spock.svg": "radial-gradient(circle, white 56%, hsl(189, 59%, 53%), hsl(189, 58%, 57%) 10%)"
};

export default Colors;
